Pagination
Utilisation
L'ajout des params pagination et initialPage dans le hook useLunatic permet d'activer la pagination (documentation de useLunatic).
En valorisant pagination à true, useLunatic renvoie de nouvelles props, dont certaines à passer en paramètre des composants.
Exemple
import React from 'react';
import * as lunatic from '@inseefr/lunatic';

const Orchestrator = ({
    source,
    data,
    savingType,
    preferences,
    features,
    management,
    pagination,
}) => {
    const {
        questionnaire,
        components,
        handleChange,
        bindings,
        pagination: {
            goNext,
            goPrevious,
            page,
            setPage,
            maxPage,
            isFirstPage,
            isLastPage,
            flow,
        },
    } = lunatic.useLunatic(source, data, {
        savingType,
        preferences,
        features,
        management,
        pagination,
    });

    const Button = lunatic.Button;

    return (


                {components.map((q) => {
                    const { id, componentType } = q;
                    const Component = lunatic[componentType];
